INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (1, "調子が上がって\nきたなっ", 2, "vo_minigame_1013_icon_1_002_001", 2, "訓練はまだ\nここからですわ", 2, 3000, "vo_minigame_1013_icon_2_002_001", 1000);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (2, "ほらほら、\nまだいけるだろ？", 2, "vo_minigame_1013_icon_1_003_001", 2, "クスクス、悪くない\n流れですわね", 2, 3000, "vo_minigame_1013_icon_2_003_001", 5000);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (3, "へへっ、おまえら\nやるじゃねえか！", 3, "vo_minigame_1013_icon_1_004_001", 2, "すばらしい\n記録ですわ", 2, 3000, "vo_minigame_1013_icon_2_004_001", 10000);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (4, "あたしたちはまだ\n止まらねえぜ！", 3, "vo_minigame_1013_icon_1_005_001", 3, "乗りに乗って\nいますわね", 2, 3000, "vo_minigame_1013_icon_2_005_001", 10000);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (5, "見てろよ！\nマコト班の快進撃だ！", 3, "vo_minigame_1013_icon_1_005_002", 3, "まだまだ行きます\nついてきなさい", 2, 3000, "vo_minigame_1013_icon_2_005_002", 10000);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (6, "うおぉぉっ！\n絶好調だぜ！", 3, "vo_minigame_1013_icon_1_005_003", 3, "エリコ班の\n本領発揮ですわ！", 2, 3000, "vo_minigame_1013_icon_2_005_003", 10000);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (7, "どこまで行けるか\n楽しみだなっ！", 3, "vo_minigame_1013_icon_1_006_001", 4, "ここからは\n前人未到の領域です！", 2, 3000, "vo_minigame_1013_icon_2_006_001", 0);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (8, "まだ諦めんなよっ", 4, "vo_minigame_1013_icon_1_007_001", 5, "厄介でしたわ…", 3, 1000, "vo_minigame_1013_icon_2_007_001", 1);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (9, "冷やっとしたぜ…！", 4, "vo_minigame_1013_icon_1_007_002", 5, "油断大敵です", 3, 1000, "vo_minigame_1013_icon_2_007_002", 1);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (10, "弱音を吐くなっ", 4, "vo_minigame_1013_icon_1_007_003", 5, "忌々しいっ…", 3, 1000, "vo_minigame_1013_icon_2_007_003", 1);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (11, "マコト班集合！", 3, "vo_minigame_1013_icon_1_008_001", 6, "大所帯ですわね", 4, 1500, "vo_minigame_1013_icon_2_008_001", 99);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (12, "連携してくぞ！", 3, "vo_minigame_1013_icon_1_008_002", 6, "エリコ班へようこそ", 4, 1500, "vo_minigame_1013_icon_2_008_002", 99);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (13, "みんなに力を！", 6, "vo_minigame_1013_icon_1_020_001", 8, "ナナカちゃんに\nお任せあれ", 1, 3000, "vo_minigame_1013_icon_2_020_001", 0);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (14, "任せてくれたまえ", 7, "vo_minigame_1013_icon_1_022_001", 9, "はっはっは！\n任せろ！", 1, 3000, "vo_minigame_1013_icon_2_022_001", 0);
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (15, "ほな、いきまひょか", 8, "vo_minigame_1013_icon_1_023_001", 10, "どんどんいくわよ", 1, 3000, "vo_minigame_1013_icon_2_023_001", 0);
